  \"Wide-ranging Online Data for Epidemiologic Research (WONDER)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 161,\n\t\t\"recent\": 4\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-04-06T23:21:49.396398\",\n\t\"name\": \"wide-ranging-online-data-for-epidemiologic-research-wonder\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>WONDER online databases include county-level
  Compressed Mortality (death certificates) since 1979; county-level Multiple Cause
  of Death (death certificates) since 1999; county-level Natality (birth certificates)
  since 1995; county-level Linked Birth / Death records (linked birth-death certificates)
  since 1995;  state &amp; large metro-level United States Cancer Statistics mortality
  (death certificates) since 1999;  state &amp; large metro-level United States Cancer
  Statistics incidence (cancer registry cases) since 1999; state and metro-level Online
  Tuberculosis Information System (TB case reports) since 1993;  state-level Sexually
  Transmitted Disease  Morbidity (case reports) since 1984; state-level Vaccine Adverse
  Event Reporting system (adverse reaction case reports) since 1990; county-level
  population estimates since 1970.  The WONDER web server also hosts the Data2010
  system with state-level data for compliance with Healthy People 2010 goals since
  1998; the National Notifiable Disease Surveillance System weekly provisional case
  reports since 1996; the 122 Cities Mortality Reporting System weekly death reports
  since 1996;  the Prevention Guidelines database (book in electronic format) published
  1998; the Scientific Data Archives (public use data sets and documentation); and
  links to other online data sources on the \"Topics\" page.</p>n\",\n\t\"license_title\":
